@MayWeAllRise The only thing is, Gralise is not cheap. But your doctor should have samples. Better to use a specialty pharmacy (like Optimum in AZ). I get my meds for $50 a month instead of $2500 through Optimum. 

As far as any natural remedies, I have no clue. Wish I did. 

(2/2)

